DROP TABLE IF EXISTS "__sm_ext_mgmt";
CREATE TABLE __sm_ext_mgmt (`id` integer primary key, `type` text not null , `value` text);
DROP TABLE IF EXISTS "tblCrucible";
CREATE TABLE "tblCrucible" ("i_crucibleID" INTEGER PRIMARY KEY  NOT NULL ,"i_positionNumber" INTEGER,"d_dateTime" DATETIME,"f_averageWeight" DOUBLE,"f_stdevWeight" DOUBLE,"v_notes" VARCHAR,"i_runID" INTEGER,"i_count" INTEGER, "f_averageTemp" DOUBLE, "f_averageHumidity" DOUBLE, "f_averageLight" FLOAT, "f_averagePressure" FLOAT, "f_stdevTemp" DOUBLE, "f_stdevHumidity" DOUBLE);
DROP TABLE IF EXISTS "tblCrucibleXY";
CREATE TABLE "tblCrucibleXY" ("i_samplePosition" int PRIMARY KEY  NOT NULL ,"i_xPosition" int,"i_yPosition" int,"v_type" VARCHAR(50),"f_xDistance" REAL,"f_yDistance" REAL,"f_zPosition" REAL,"f_weightAverage" REAL,"f_weightStdDev" REAL, "d_weightDateTime" DATETIME);
DROP TABLE IF EXISTS "tblMeasurement";
CREATE TABLE "tblMeasurement" ("i_measurementID" INTEGER PRIMARY KEY  NOT NULL ,"i_sampleID" INTEGER,"i_positionNumber" INTEGER,"i_preOrPost" INTEGER,"f_weight" DOUBLE,"d_dateTime" DATETIME,"f_elapsedTimeMin" DOUBLE,"f_temperature" FLOAT,"f_pressure" FLOAT,"f_light" FLOAT,"i_runID" INTEGER,"f_standardWeight" DOUBLE,"f_elapsedTimeQuarterPower" DOUBLE,"i_count" INTEGER,"v_status" VARCHAR,"f_humidity" FLOAT,"i_repetition" INTEGER,"i_repetitionCount" INTEGER);
DROP TABLE IF EXISTS "tblRun";
CREATE TABLE "tblRun" ("i_runID" INTEGER PRIMARY KEY  NOT NULL ,"v_locationCode" VARCHAR(45),"i_numberOfSamples" INTEGER,"d_datetime" DATETIME,"v_operatorName" VARCHAR(45),"i_equilbrationDuration" INTEGER,"i_preMeasurementTimeInterval" INTEGER,"i_postMeasurementTimeInterval" INTEGER,"d_dateTimeFiring" DATETIME,"i_durationOfFiring" INTEGER,"i_temperatureOfFiring" INTEGER,"i_loggingInterval" INTEGER,"i_durationofPreMeasurements" INTEGER,"i_numberOfPreMeasurements" INTEGER,"i_durationOfPostMeasurements" INTEGER,"i_numberOfPostMeasurements" INTEGER,"v_description" VARCHAR(255),"d_endOfFiring" DATETIME,"f_humidity" FLOAT,"f_temperature" FLOAT,"v_status" VARCHAR);
DROP TABLE IF EXISTS "tblSample";
CREATE TABLE "tblSample" ("i_sampleID" INTEGER PRIMARY KEY  NOT NULL ,"i_positionNumber" INTEGER,"f_crucibleWeightAverage" DOUBLE,"f_crucibleWeightStdDev" DOUBLE,"f_preWeightAverage" DOUBLE,"f_preWeightStdDev" DOUBLE,"f_temperatureAverage" DOUBLE,"f_temperatureStdDev" DOUBLE,"f_humidityAverage" DOUBLE,"f_humidityStDev" DOUBLE,"f_pressureAverage" DOUBLE,"f_pressureStDev" DOUBLE,"f_lightAverage" DOUBLE,"f_lightStdDev" DOUBLE,"d_datetime" DATETIME,"i_runID" INTEGER,"i_crucibleID" INTEGER,"f_elapsedTime" DOUBLE,"i_count" INTEGER,"v_description" VARCHAR(255),"v_locationCode" VARCHAR(255),"i_preOrPost" INTEGER,"i_loggingInterval" INTEGER,"v_status" VARCHAR(40),"i_preMeasurementTimeInterval" INTEGER,"f_temperature" DOUBLE,"f_humidity" DOUBLE,"i_repetitions" INTEGER);
DROP TABLE IF EXISTS "tblXY";
CREATE TABLE "tblXY" ("t_lastUpdate" DATETIME DEFAULT CURRENT_TIMESTAMP, "d_lastUpdateDate" DATETIME DEFAULT CURRENT_DATE, "t_lastUpdateTime" DATETIME DEFAULT CURRENT_TIME, "i_xposition" INTEGER, "i_yposition" INTEGER check(typeof("i_yposition") = 'integer') );
CREATE UNIQUE INDEX "tblCrucibleIndex" ON "tblCrucible" ("i_crucibleID" ASC, "i_positionNumber" ASC, "i_runID" ASC);
CREATE UNIQUE INDEX "tblRunIndex" ON "tblRun" ("i_runID" ASC, "v_locationCode" ASC, "i_numberOfSamples" ASC, "d_datetime" ASC);
